import React from 'react'
import Sidebar from '../components/Nav/Sidebar'
import Welcome from '../components/Sections/Welcome'
import PostSlider from '../components/Posts/PostSlider'
import InstaPreview from '../components/Sections/InstaPreview'
import styled from 'styled-components';

const Page = styled.div`
    max-width:76em;
    margin-left:auto;
    margin-right:auto;
    @media (max-width: 76em) {
        margin-right:calc(var(--sidebar-width) + 4em);
    }
    display:flex;
`
const Sections = styled.div`
    margin:0 calc(var(--sidebar-width) + 4em);  
    max-width:76em;
    @media (max-width: 76em) {
        margin-right:0;
    }
    @media (max-width: 45em) {
        margin:0;
    }
`


export default function Home() {
    return (
        <Page>
            <Sections>
                <Welcome />
                <PostSlider category="photo"/>
                <InstaPreview/>
            </Sections>
            <Sidebar/>
        </Page>
    )
}
